import React, { Component } from "react";
import "./Chat.css";
class ChatHead extends Component {
  state = {};
  render() {
    return (
      <div>
        <div className="Card">
          <div class="row">
            <div class="col s2">
              <div className="Avatar" />
            </div>
            <div class="col s8">
              <div className="User">Avuceo</div>
            </div>
            <div class="col s2">
              <div className="Time">SS</div>
            </div>
            <div className="Text">
              The CSS list properties allow you to: Set different list item
              markers for ordered lists Set different list item markers for
              unordered lists Set an image as the list item marker Add
              background colors to lists and list items
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ChatHead;
